USE SeattleHousing_db
GO

-- Drop tables if they exist
DROP TABLE IF EXISTS tblRentalDetail;
DROP TABLE IF EXISTS tblPropertyTransactions;
DROP TABLE IF EXISTS tblOwnership;
DROP TABLE IF EXISTS tblDemographicInfo;
DROP TABLE IF EXISTS tblProperty;
DROP TABLE IF EXISTS tblRenter;
DROP TABLE IF EXISTS tblNeighborhood;
DROP TABLE IF EXISTS tblPropertyType;
DROP TABLE IF EXISTS tblOwner;

-- Create tables
DROP TABLE IF EXISTS tblOwner;
CREATE TABLE tblOwner (
    OwnerID INTEGER PRIMARY KEY IDENTITY(1,1),
    FullName VARCHAR(100) NOT NULL,
    PhoneNumber VARCHAR(15),
    Email VARCHAR(100)
);

DROP TABLE IF EXISTS tblRenter;
CREATE TABLE tblRenter (
    RenterID INTEGER PRIMARY KEY IDENTITY(1,1),
    FirstName VARCHAR(50) NOT NULL,
    LastName VARCHAR(50) NOT NULL,
    PhoneNumber VARCHAR(15),
    Email VARCHAR(100)
);

DROP TABLE IF EXISTS tblNeighborhood;
CREATE TABLE tblNeighborhood (
    NeighborhoodID INTEGER PRIMARY KEY IDENTITY(1,1),
    NeighborhoodName VARCHAR(100) NOT NULL
);

DROP TABLE IF EXISTS tblDemographicInfo;
CREATE TABLE tblDemographicInfo (
    DemographicID INTEGER PRIMARY KEY IDENTITY(1,1),
    NeighborhoodID INTEGER NOT NULL,
    YearRecorded INTEGER NOT NULL,
    MedianIncome DECIMAL(18, 2),
    TotalPopulation INTEGER,
    CrimeRate DECIMAL(5, 2),
    WhitePopulation INTEGER,
    BlackPopulation INTEGER,
    HispanicPopulation INTEGER,
    AsianPopulation INTEGER,
    MalePopulation INTEGER,
    FemalePopulation INTEGER,
    NonBinaryPopulation INTEGER,
    QueerPopulation INTEGER
);


DROP TABLE IF EXISTS tblPropertyType;
CREATE TABLE tblPropertyType (
    PropertyTypeID INTEGER PRIMARY KEY IDENTITY(1,1),
    PropertyTypeName VARCHAR(50) NOT NULL
);

DROP TABLE IF EXISTS tblProperty;
CREATE TABLE tblProperty (
    PropertyID INTEGER PRIMARY KEY IDENTITY(1,1),
    NeighborhoodID INTEGER NOT NULL,
    PropertyTypeID INTEGER NOT NULL,
    MarketValue DECIMAL(18, 2),
    AddressNumber VARCHAR(10),
    StreetName VARCHAR(100),
    StreetSuffix VARCHAR(10),
    AddressLine2 VARCHAR(50),
    City VARCHAR(50),
    ZipCode VARCHAR(10),
    NumBedrooms INTEGER,
    NumBathrooms INTEGER,
    SquareFeet INTEGER
);


DROP TABLE IF EXISTS tblOwnership;
CREATE TABLE tblOwnership (
    OwnershipID INTEGER PRIMARY KEY IDENTITY(1,1),
    PropertyID INTEGER NOT NULL,
    OwnerID INTEGER NOT NULL,
    OwnershipStartYear INTEGER NOT NULL,
    OwnershipEndYear INTEGER
);

DROP TABLE IF EXISTS tblPropertyTransactions;
CREATE TABLE tblPropertyTransactions (
    TransactionID INTEGER PRIMARY KEY IDENTITY(1,1),
    OwnerID INTEGER NOT NULL,
    PropertyID INTEGER NOT NULL,
    PurchaseDate DATE,
    PurchasePrice DECIMAL(18, 2),
    SoldDate DATE,
    SoldPrice DECIMAL(18, 2)
);

DROP TABLE IF EXISTS tblRentalDetail
CREATE TABLE tblRentalDetail (
    RentalDetailID INTEGER PRIMARY KEY IDENTITY(1,1),
    PropertyID INTEGER NOT NULL,
    RenterID INTEGER NOT NULL,
    StartDate DATE NOT NULL,
    EndDate DATE,
    RentalPrice VARCHAR(100)
);

-- Add FK constraints
ALTER TABLE tblProperty
ADD CONSTRAINT FK_Property_Neighborhood
FOREIGN KEY (NeighborhoodID) REFERENCES tblNeighborhood(NeighborhoodID);

ALTER TABLE tblDemographicInfo
ADD CONSTRAINT FK_Demographic_Neighborhood
FOREIGN KEY (NeighborhoodID) REFERENCES tblNeighborhood(NeighborhoodID);

ALTER TABLE tblProperty
ADD CONSTRAINT FK_Property_PropertyType
FOREIGN KEY (PropertyTypeID) REFERENCES tblPropertyType(PropertyTypeID);

ALTER TABLE tblOwnership
ADD CONSTRAINT FK_Ownership_Property
FOREIGN KEY (PropertyID) REFERENCES tblProperty(PropertyID);

ALTER TABLE tblOwnership
ADD CONSTRAINT FK_Ownership_Owner
FOREIGN KEY (OwnerID) REFERENCES tblOwner(OwnerID);

ALTER TABLE tblPropertyTransactions
ADD CONSTRAINT FK_Transactions_Owner
FOREIGN KEY (OwnerID) REFERENCES tblOwner(OwnerID);

ALTER TABLE tblPropertyTransactions
ADD CONSTRAINT FK_Transactions_Property
FOREIGN KEY (PropertyID) REFERENCES tblProperty(PropertyID);

ALTER TABLE tblRentalDetail
ADD CONSTRAINT FK_RentalDetail_Property
FOREIGN KEY (PropertyID) REFERENCES tblProperty(PropertyID);

ALTER TABLE tblRentalDetail
ADD CONSTRAINT FK_RentalDetail_Renter
FOREIGN KEY (RenterID) REFERENCES tblRenter(RenterID);

